class Solution:

    # calculate simple expression, without parentheses
    def calc_simple_unit(self, s: str) -> str:
        s += ' '
        i = 0
        operation_type = ''
        operation_start_idx = -1
        nums = []
        while True:
            if ''.join(s.split()).lstrip('-').isnumeric() or ''.join(s.split()).lstrip('+').isnumeric(): break
            if (len(nums) > 0) and ((s[i] == '+') or (s[i] == '-')): operation_type = s[i]
            if (s[i].isnumeric()) or \
                    ((len(nums) == 0) and ((s[i] == '+') or (s[i] == '-'))):
                if operation_start_idx == -1: operation_start_idx = i
                for j in range(i + 1, len(s)):
                    if not s[j].isnumeric():
                        nums.append(s[i:j])
                        i = j - 1
                        if (len(nums) == 2) and (operation_type != ''):
                            if operation_type == '+':
                                r0 = int(nums[0]) + int(nums[1])
                            else:
                                r0 = int(nums[0]) - int(nums[1])
                            s = s[:operation_start_idx] + str(r0) + s[j:]
                            operation_type = ''
                            operation_start_idx = -1
                            nums = []
                            i = -1
                        break
            i += 1
        s = ''.join(s.split())
        return s

    def negator(self, s: str) -> str:
        s = s.replace('-', '~')
        s = s.replace('+', '-')
        s = s.replace('~', '+')
        return s

    def parentheses_opener(self, s: str) -> str:
        s = ''.join(s.split())
        while True:
            parentheses_dp = {}
            i = -1
            while True:
                i = s.find('(', i + 1)
                if i < 0: break
                parentheses_dp[i] = '('
            i = -1
            while True:
                i = s.find(')', i + 1)
                if i < 0: break
                parentheses_dp[i] = ')'

            if len(parentheses_dp) == 0: break

            p_start_idx = -1
            for idx in sorted(parentheses_dp):
                if parentheses_dp[idx] == '(':
                    p_start_idx = idx
                elif parentheses_dp[idx] == ')':
                    p_end_idx = idx
                    s0 = s[p_start_idx + 1:p_end_idx]
                    if (p_start_idx > 0) and (s[p_start_idx - 1] == '-'): s0 = self.negator(s0)
                    s = s[:p_start_idx] + s0 + s[p_end_idx + 1:]

                    parentheses_dp.pop(idx)
                    parentheses_dp.pop(p_start_idx)
                    break

        return s

    def slow_parentheses_opener(self, s: str) -> str:
        s = ''.join(s.split())
        open_parentheses_idx = -1
        parentheses_sign = '+'
        parentheses_level = 0
        i = 0
        while i < len(s):
            if s[i] == '(':
                if open_parentheses_idx == -1:
                    open_parentheses_idx = i
                    if (i > 0) and (s[i - 1] == '-'): parentheses_sign = '-'
                parentheses_level += 1
            elif s[i] == ')':
                parentheses_level -= 1
                if parentheses_level == 0:
                    s0 = self.parentheses_opener(s[open_parentheses_idx + 1:i])
                    if parentheses_sign == '-': s0 = self.negator(s0)
                    s = s[:open_parentheses_idx] + s0 + s[i + 1:]
                    open_parentheses_idx = -1
                    parentheses_sign = '+'
                    i = -1
            i += 1
        return s

    def optimizer(self, s: str) -> str:
        s = ''.join(s.split())
        minimal_optimized_len = 11
        i = 5
        while i <= len(s) - minimal_optimized_len - 1:
            if s[i].isnumeric() and (s[i + 1] == '+') and s[i + 2].isnumeric():
                start_idx = i + 2
                pidx0 = s.find(')', start_idx) - start_idx
                if pidx0 < 0: pidx0 = len(s)
                pidx1 = s.find('(', start_idx) - start_idx
                if pidx1 < 0: pidx1 = len(s)
                pidx = min(pidx0, pidx1)
                if pidx > minimal_optimized_len:
                    # pidx -= 3
                    while not ((s[start_idx + pidx - 1].isnumeric()) and
                               ((s[start_idx + pidx - 2] == '+') or (s[start_idx + pidx - 2] == '-')) and
                               (s[start_idx + pidx - 3].isnumeric())):
                        pidx -= 1
                    pidx -= 2
                    s0 = self.calc_simple_unit(s[start_idx:start_idx + pidx])
                    negative_adjustment = 1 if int(s0) < 0 else 0
                    s = s[:start_idx - negative_adjustment] + s0 + s[start_idx + pidx:]
                else:
                    i += pidx - 1

            i += 1

        return s

    def calculate(self, s: str) -> int:
        if s.count('(') != s.count(')'):
            print(f"( = {s.count('(')}")
            print(f") = {s.count(')')}")
            return

        s = self.optimizer(s)
        s = self.parentheses_opener(s)
        s = self.calc_simple_unit(s)
        return int(s)


